                                          <v-spacer></v-spacer>
                                          <v-icon @click="cropDialog = false"
                                            >mdi-close</v-icon
                                          >
                                        </v-card-title>

                                        <v-card-text class="pa-2">
                                          <Cropper
                                            :src="currentCropperImage"
