<script>
import AdminLayout from "../../components/AdminLayout";
import VueUploadMultipleImage from "../../components/VueUploadMultipleImage";
import VueImageLightboxCarousel from "vue-image-lightbox-carousel";
import Popper from "vue-popperjs";

import { forEach, findIndex, orderBy, cloneDeep } from "lodash";
import { Cropper } from "vue-advanced-cropper";

import "vue-popperjs/dist/css/vue-popper.css";
import "vue-advanced-cropper/dist/style.css";

export default {
  name: "Test",

  data() {
    return {
      dialog: false,
      dialogDelete: false,
      headers: [
        {
          text: "#",
          align: "start",
          sortable: true,
          value: "id",
        },
        {
          text: "Dessert (100g serving)",
          align: "start",
          sortable: false,
          value: "name",
        },
        {
          text: this.$t("calories"),
          value: "calories",
        },
        { text: this.$t("fat"), value: "fat" },
        { text: "Carbs (g)", value: "carbs" },
        { text: "Protein (g)", value: "protein" },
        { text: "Actions", value: "actions", sortable: false },
      ],
      desserts: [],
      editedIndex: -1,
      editedItem: {
        name: "",
        calories: 0,
        fat: 0,
        carbs: 0,
        protein: 0,
        cropperImage: [],
      },
      defaultItem: {
        name: "",
        calories: 0,
        fat: 0,
        carbs: 0,
        protein: 0,
        cropperImage: [],
      },
      // images: [],
      flatList: [],
      currentIndexImage: 0,

      images: [],
      isDragover: false,
      showLightbox: false,
      arrLightBox: [],
      cropDialog: false,
      cropped: "",
      currentCropperImage: "",
      removeImageDialog: false,
      removeImageConfirmedState: false,
      errorFound: "",
      browseText: "Browse Files",
      idUpload: " image-upload",
      dragText: "Drag and Drop",
      multiple: true,
      accept: "image/gif,image/jpeg,image/png,image/bmp,image/jpg",
      disabled: false,
      showEdit: true,
      showDelete: true,
      showPrimary: true,
      showAdd: true,
      idEdit: " image-edit",
      markIsPrimaryText: "",
      maxImage: 10,
    };
  },
  components: {
    AdminLayout,
    VueUploadMultipleImage,
    VueImageLightboxCarousel,
    Popper,
    Cropper,
  },
  computed: {
    formTitle() {
      return this.editedIndex === -1 ? "New Item" : "Edit Item";
    },
    imagePreview() {
      let index = findIndex(this.images, { highlight: 1 });
      this.currentImage = this.images[this.currentIndexImage].path;
      if (index > -1) {
        return this.images[index].path;
      } else {
        return this.images.length ? this.images[0].path : "";
      }
    },
    imageDefault() {
      if (this.images[this.currentIndexImage]) {
        return this.images[this.currentIndexImage].default;
      }
    },
  },

  watch: {
    // dataImages: {
    //   handler: function(newVal) {
    //     this.images = cloneDeep(newVal);
    //   },
    //   deep: true,
    // },
    dialog(val) {
      val || this.close();
    },
    dialogDelete(val) {
      val || this.closeDelete();
    },
  },

  created() {
    this.initialize();
    this.images = [];
    // this.images = cloneDeep(this.dataImages);
  },
  mounted() {
    document.body.addEventListener("dragleave", (event) => {
      event.stopPropagation();
      event.preventDefault();
      this.isDragover = false;
    });
  },

  methods: {
    saveCropperImages() {
      console.log("saved cropper images");
      // console.log(this.images);
      // this.flatList.push(this.images);
      console.log("stored to flatlist");
    },
    preventEvent(e) {
      e.preventDefault();
      e.stopPropagation();
    },
    uploadFieldChange(e) {
      let files = e.target.files || e.dataTransfer.files;
      if (!files.length) {
        return false;
      }
      if (!this.isValidNumberOfImages(files.length)) {
        return false;
      }
      forEach(files, (value, index) => {
        this.createImage(value);
      });
      if (document.getElementById(this.idUpload)) {
        document.getElementById(this.idUpload).value = [];
      }
    },
    editFieldChange(e) {
      // console.log(e);
      let files = e.target.files || e.dataTransfer.files;
      if (!files.length) {
        return false;
      }
      if (!this.isValidNumberOfImages(files.length)) {
        return false;
      }
      forEach(files, (value, index) => {
        this.editImageVal(value);
      });
      if (document.getElementById(this.idEdit)) {
        document.getElementById(this.idEdit).value = "";
      }
    },
    changeHighlight(currentIndex) {
      this.currentIndexImage = currentIndex;
      let arr = this.images;
      this.images = [];
      arr.map((item, index) => {
        if (currentIndex === index) {
          item.highlight = 1;
        } else {
          item.highlight = 0;
        }
        return item;
      });
      this.images = arr;
    },
    // emit
    // deleteImage(currentIndex) {
    //   this.removeImageDialog = true;
    //   this.$emit(
    //     "before-remove",
    //     currentIndex,
    //     () => {
    //       if (this.images[currentIndex].default === 1) {
    //         this.images[0].default = 1;
    //       }
    //       this.images.splice(currentIndex, 1);
    //       this.currentIndexImage = 0;
    //       if (this.images.length) {
    //         this.images[0].highlight = 1;
    //       }
    //     },
    //     this.images,
    //     "false"
    //   );
    // },
    deleteImage(currentIndex) {
      this.removeImageDialog = true;
    },
    // emit
    removeImage(currentIndex) {
      if (this.images[currentIndex].default === 1) {
        this.images[0].default = 1;
      }
      this.images.splice(currentIndex, 1);
      this.currentIndexImage = 0;
      if (this.images.length) {
        this.images[0].highlight = 1;
      }
      this.removeImageDialog = false;
      console.log("array after deleted: ", this.images);
    },

    // emit
    markIsPrimary(currentIndex) {
      this.images.map((item, index) => {
        if (currentIndex === index) {
          item.highlight = 1;
          item.default = 1;
        } else {
          item.highlight = 0;
          item.default = 0;
        }
        return item;
      });
      this.currentIndexImage = 0;
      this.images = orderBy(this.images, "default", "desc");
      this.$emit("mark-is-primary", currentIndex, this.images);
    },
    // emit -done
    createImage(file) {
      if (this.disabled) return;
      let reader = new FileReader();
      let formData = new FormData();
      formData.append("file", file);
      reader.onload = (e) => {
        let dataURI = e.target.result;
        if (dataURI) {
          if (!this.images.length) {
            this.images.push({
              name: file.name,
              path: dataURI,
              highlight: 1,
              default: 1,
            });
            this.currentIndexImage = 0;
          } else {
            this.images.push({
              name: file.name,
              path: dataURI,
              highlight: 0,
              default: 0,
            });
          }
          this.uploadImageSuccess(
            formData,
            this.images.length - 1,
            this.images
          );
        }
      };
      reader.readAsDataURL(file);
    },
    // emit -done
    editImageVal(file) {
      if (this.disabled) return;
      let reader = new FileReader();
      let formData = new FormData();
      formData.append("file", file);
      reader.onload = (e) => {
        let dataURI = e.target.result;
        if (dataURI) {
          if (this.images.length && this.images[this.currentIndexImage]) {
            this.images[this.currentIndexImage].path = dataURI;
            this.images[this.currentIndexImage].name = file.name;
          }
        }
      };
      reader.readAsDataURL(file);
      // this.$emit("edit-image", formData, this.currentIndexImage, this.images);
      this.editImage(formData, this.currentIndexImage, this.images);
    },
    onDrop(e) {
      this.isDragover = false;
      e.stopPropagation();
      e.preventDefault();
      let files = e.dataTransfer.files;
      if (!files.length) {
        return false;
      }
      if (!this.isValidNumberOfImages(files.length)) {
        return false;
      }
      forEach(files, (value, index) => {
        this.createImage(value);
        if (!this.multiple) {
          return false;
        }
      });
      if (document.getElementById(this.idUpload)) {
        document.getElementById(this.idUpload).value = [];
      }
    },
    onDragover() {
      this.isDragover = true;
    },
    change({ coordinates, canvas }) {
      // console.log(coordinates, canvas);
      // console.log(this.images[this.currentIndexImage].path)
      this.cropped = canvas.toDataURL();
      // console.log(canvas.toDataURL());
    },
    CropImage(i) {
      console.log(i);
      console.log(this.images);
      // this.images.splice(i, 1);
      this.images.find((file) => {
        if (file.path === i.path) {
          file.path = this.cropped;
        }
      });
      console.log(" path updated");
      console.log(this.images);
      this.cropDialog = false;
    },
    cropDialogOpener(e) {
      console.log(e);
      this.cropDialog = true;
      this.currentCropperImage = e.path;
    },
    openGallery(index) {   
      this.showLightbox = true;
      this.$refs.lightbox.showImage(index);
    },
    onOpenedLightBox(value) {
      if (value) {
        this.showLightbox = true;
      } else {
        this.showLightbox = false;
      }
    },
    isValidNumberOfImages(amount) {
      if (amount > this.maxImage) {
        this.$emit("limit-exceeded", amount);
        return false;
      } else {
        return true;
      }
    },

    //------------------------------------------------
    initialize() {
      this.desserts = [
        {
          name: "Frozen Yogurt",
          calories: 159,
          fat: 6.0,
          carbs: 24,
          protein: 4.0,
          cropperImage: [
            {
              default: 1,
              highlight: 1,
              name: "image (3).jpg",
              path:
                "data:image/jpeg;base64,",
            },
            {
              default: 1,
              highlight: 1,
              name: "image (3).jpg",
              path:
                "data:image/jpeg;base64,",
            },
          ],
        },
        {
          name: "Ice cream sandwich",
          calories: 237,
          fat: 9.0,
          carbs: 37,
          protein: 4.3,
        },
      ];
    },
    dataChange(data) {
      console.log(data);
    },
    uploadImageSuccess(formData, index, fileList) {
      console.log("uploadImageSuccess:", formData, index, fileList);
      // this.flatList = fileList;
    },
    beforeRemove(index, done, fileList) {
      console.log("index", index, fileList);
      var r = confirm("remove image");
      if (r == true) {
        done();
      } else {
      }
    },
    NewItem() {
      this.dialog = !this.dialog;
      this.images.splice(0);
      // this.flatList.splice(0);
    },
    editImage(formData, index, fileList) {
      console.log("edit data :", formData, index, fileList);
    },
    editItem(item) {
      this.editedIndex = this.desserts.indexOf(item);
      this.editedItem = Object.assign({}, item);
      this.dialog = true;
      console.log(this.editedItem);

      this.editedItem.cropperImage.forEach((element) => {
        this.images.push(element);
      });
    },

    deleteItem(item) {
      this.editedIndex = this.desserts.indexOf(item);
      this.editedItem = Object.assign({}, item);
      this.dialogDelete = true;
    },

    deleteItemConfirm() {
      this.desserts.splice(this.editedIndex, 1);
      this.closeDelete();
    },

    close() {
      this.dialog = false;
      this.$nextTick(() => {
        this.editedItem = Object.assign({}, this.defaultItem);
        this.editedIndex = -1;
      });
    },

    closeDelete() {
      this.dialogDelete = false;
      this.$nextTick(() => {
        this.editedItem = Object.assign({}, this.defaultItem);
        this.editedIndex = -1;
      });
    },

    save() {
      if (this.editedIndex > -1) {
        Object.assign(this.desserts[this.editedIndex], this.editedItem);
      } else {
        console.log(this.images);
        this.desserts.push({
          name: this.editedItem.name,
          calories: this.editedItem.calories,
          fat: this.editedItem.fat,
          carbs: this.editedItem.carbs,
          protein: this.editedItem.protein,
          cropperImage: this.images,
        });
      }
      this.close();
    },
  },
};
</script>

